import { Row, Col, Button, Layout } from 'antd';
const { Header, Footer, Sider, Content } = Layout;

function Home() {
  return (
    <Layout>
      <Header>
        <Row>
          <Col></Col>
          <Col>
            <Button type="danger">APP</Button>
          </Col>
        </Row>
      </Header>
      <Content>Content</Content>
      <Footer>Footer</Footer>
    </Layout>
  );
}

export default Home;
